void TimeValMinus(timeval& tvA, timeval& tvB, timeval& tvResult)
{
    if( tvA.tv_usec < tvB.tv_usec )
    {
        tvResult.tv_usec = (1000000 + tvA.tv_usec) - tvB.tv_usec;
        tvResult.tv_sec = tvA.tv_sec - tvB.tv_sec - 1;
    }
    else
    {
        tvResult.tv_usec = tvA.tv_usec - tvB.tv_usec;
        tvResult.tv_sec  = tvA.tv_sec - tvB.tv_sec;
    }
}

void TrimStr( char *strInput )
{
    char *pb;
    char *pe;
    int iTempLength;

    if( strInput == NULL )
    {
        return;
    }

    iTempLength = strlen(strInput);
    if( iTempLength == 0 )
    {
        return;
    }

    pb = strInput;

    while (((*pb == ' ') || (*pb == '\t') || (*pb == '\n') || (*pb == '\r')) && (*pb != 0))
    {
        pb ++;
    }

    pe = &strInput[iTempLength-1];
    while ((pe >= pb) && ((*pe == ' ') || (*pe == '\t') || (*pe == '\n') || (*pe == '\r')))
    {
        pe --;
    }

	pe++;
	*pe = '\0';

	size_t nMoveLen = pe - pb + 1;
	if( strInput != pb )
	{
		memmove(strInput, pb, nMoveLen);
	}
}

int GetDateString(char *strTime)
{
    struct tm *pTempTm = NULL;
    time_t timer;

    if( !strTime )
    {
        return -1;
    }

    time( &timer );

    strTime[0] = '\0';

    pTempTm = localtime( &timer );

    if( !pTempTm )
    {
        return -1;
    }

    sprintf(strTime, "%04d-%02d-%02d", pTempTm->tm_year + 1900, pTempTm->tm_mon + 1, pTempTm->tm_mday);

    return 0;
}

