int RecvDataFrom(int iSocket, void *pData, int nDataLen, char *szSrcIP, unsigned short* pnSrcPort)
{
    struct sockaddr_in stTempSockAddr;
    socklen_t iTempAddrLen = 0;
    int iRecvBytes = 0;

    if( !szSrcIP || iSocket < 0 || !pData || nDataLen <= 0 || !pnSrcPort )
    {
        return -1;
    }

    memset((void *)&stTempSockAddr, 0, sizeof( stTempSockAddr ) );
    iTempAddrLen = sizeof(stTempSockAddr);
#ifdef WIN32
	iRecvBytes = recvfrom( iSocket, (char*)pData, nDataLen, 0, (struct sockaddr *)&stTempSockAddr, (socklen_t *)&iTempAddrLen );
#else
    iRecvBytes = recvfrom( iSocket, pData, nDataLen, 0, (struct sockaddr *)&stTempSockAddr, (socklen_t *)&iTempAddrLen );
#endif

    if( iRecvBytes < 0 && errno != EAGAIN )
    {
        return iRecvBytes;
    }

    strcpy(szSrcIP, inet_ntoa(stTempSockAddr.sin_addr));
    *pnSrcPort = ntohs(stTempSockAddr.sin_port);

    return iRecvBytes;
}



int SockAddrToString(sockaddr_in *pstSockAddr, char *szResult)
{
    char *pcTempIP = NULL;
    unsigned short nTempPort = 0;

    if( !pstSockAddr || !szResult )
    {
        return -1;
    }

    pcTempIP = inet_ntoa(pstSockAddr->sin_addr);

    if( !pcTempIP )
    {
        return -1;
    }

    nTempPort = ntohs(pstSockAddr->sin_port);

    sprintf(szResult, "%s:%d", pcTempIP, nTempPort);

    return 0;
}

