#ifndef WIN32
int SetNBlock(int iSock)
{
    int iFlags;
    iFlags = fcntl(iSock, F_GETFL, 0);
    iFlags |= O_NONBLOCK;
    iFlags |= O_NDELAY;
    fcntl(iSock, F_SETFL, iFlags);
    return 0;
}
#else
int SetNBlock(SOCKET iSock)
{
    unsigned long ul = 1;
    int ret = ioctlsocket(iSock, FIONBIO, (unsigned long*)&ul);
    if(ret == SOCKET_ERROR)
    {
        return -1;
    }
    return 0;
}
#endif

