int CreateUdpSocket(int iBlockFlag , unsigned short nPort, char *szIP, int iRecvTimeoutMs)
{
    int iTempSocket = -1;
    struct sockaddr_in stTempSockAddr;


    iTempSocket = socket(AF_INET,SOCK_DGRAM, 0);
    if( iTempSocket < 0 )
    {
        return iTempSocket;
    }

    if( iBlockFlag )
    {
        SetNBlock(iTempSocket);
    }

	if( iRecvTimeoutMs > 0 )
	{	
#ifndef WIN32
		int second  = iRecvTimeoutMs/1000;
		int msecond = iRecvTimeoutMs%1000;
		struct timeval tv;
		tv.tv_sec = second;
		tv.tv_usec = msecond * 1000;
		socklen_t opt_len = sizeof(tv);
		setsockopt(iTempSocket, SOL_SOCKET, SO_RCVTIMEO, (const void*)&tv, opt_len);
#else
		int nTimeoutMs = iRecvTimeoutMs;
		setsockopt(iTempSocket, SOL_SOCKET, SO_RCVTIMEO, (const char*)&nTimeoutMs, sizeof(nTimeoutMs));
#endif
	}

    if( nPort == 0 )
    {
        return iTempSocket;
    }
    
    memset((void *)&stTempSockAddr, 0, sizeof( stTempSockAddr ) );
    stTempSockAddr.sin_family = AF_INET;
    if( szIP )
    {
        stTempSockAddr.sin_addr.s_addr = inet_addr( szIP );
    }
    else
    {
        stTempSockAddr.sin_addr.s_addr = INADDR_ANY;
    }

    stTempSockAddr.sin_port = htons( nPort );

    if( bind(iTempSocket, (struct sockaddr *)&stTempSockAddr, sizeof(stTempSockAddr)) )
    {
#ifdef WIN32
		closesocket(iTempSocket);
#else
		close(iTempSocket);
#endif  
        return -1;
    }
    
    return iTempSocket;
}

int SendDataTo(int iSocket, void *pData, int nDataLen, char *szDstIP, unsigned short nDstPort)
{
    struct sockaddr_in stTempSockAddr;
    int iSentBytes = 0;

    if( !szDstIP || iSocket < 0 || !pData || nDataLen <= 0 )
    {
        return -1;
    }

    memset((void *)&stTempSockAddr, 0, sizeof( stTempSockAddr ) );
    stTempSockAddr.sin_family = AF_INET;
    stTempSockAddr.sin_addr.s_addr = inet_addr( szDstIP );
    stTempSockAddr.sin_port = htons( nDstPort );
#ifndef WIN32
    iSentBytes = sendto( iSocket, (const void *)pData, nDataLen, 0, (const struct sockaddr *)&stTempSockAddr, sizeof(stTempSockAddr) );
#else
    iSentBytes = sendto( iSocket, (const char *)pData, nDataLen, 0, (const struct sockaddr *)&stTempSockAddr, sizeof(stTempSockAddr) );
#endif
    if( iSentBytes < 0 )
    {
        LOG("Send data to %s:%d failed(%d), %s\n", szDstIP, nDstPort, errno, strerror(errno));
        return iSentBytes;
    }

    return iSentBytes;

}


int SplitMapStr(const char *pMapStr, int iMaxItemNum, int *pItemArray, char szGap /* = ',' */)
{
    char szTempStr[1024];
    char *pTemp1 = NULL;
    char *pTemp2 = NULL;
    char *pTemp3 = NULL;
    char *pTemp4 = NULL;
    int iStart;
    int iStop, i;
    int iTempCount = 0;
    int iLength;

    if(!pMapStr || !pItemArray || iMaxItemNum < 0)
    {
        return -1;
    }
    memset(szTempStr, '\0', sizeof(szTempStr));
    sprintf(szTempStr,"%s",  pMapStr);
    pTemp1 = &szTempStr[0];
    if(strchr(pTemp1, ' '))
    {
        LOG("Error in put map str, contained tab space\n");
        return -1;
    }
    iLength = strlen(pTemp1);
    for(i = 0; i < iLength; i++)
    {
        if((pTemp1[i] > '9' || pTemp1[i] < '0') && pTemp1[i] != szGap && pTemp1[i] != '-')
        {
            LOG("Error in put map str, contained error char\n");
            return -1;
        }
    }
    while(pTemp2 = strchr(pTemp1, szGap))
    {
        if(iTempCount == iMaxItemNum)
        {
            return iTempCount;
        }
        *pTemp2 = '\0';
        if(strlen(pTemp1)  ==  0)
        {
            LOG("Error:Split Map Str Failed, str in null or space\n");
            return -1;
        }

        if(pTemp3 = strchr(pTemp1, '-'))
        {
            *pTemp3 = '\0';
            iStart = atoi(pTemp1);
            iStop = atoi(pTemp3 + 1);
            if(iStop < iStart)
            {
                LOG("Error:Split Map Str Failed, Range start big(%d) than stop(%d)\n", iStart, iStop);
                return -1;
            }

            for(i = iStart; i <= iStop && iTempCount < iMaxItemNum; i++)
            {
                pItemArray[iTempCount] =  i;
                //LOG("Item[%d]= %d\n", iTempCount, i);
                iTempCount ++;

            }
        }
        else
        {
            pItemArray[iTempCount] =  atoi(pTemp1);
            //LOG("Item[%d]= %d\n", iTempCount, pItemArray[iTempCount] );
            iTempCount ++;

        }
        pTemp1 = pTemp2 + 1;
    }
    if(pTemp1 && iTempCount < iMaxItemNum)
    {
        if(pTemp3 = strchr(pTemp1, '-'))
        {
            *pTemp3 = '\0';
            iStart = atoi(pTemp1);
            iStop = atoi(pTemp3 + 1);
            if(iStop < iStart)
            {
                LOG("Error:Split Map Str Failed, Range start big(%d) than stop(%d)\n", iStart, iStop);
                return -1;
            }

            for(i = iStart; i <= iStop && iTempCount < iMaxItemNum; i++)
            {
                pItemArray[iTempCount] =  i;
                //LOG("Item[%d]= %d\n", iTempCount, i);
                iTempCount ++;
            }
        }
        else
        {
            pItemArray[iTempCount] =  atoi(pTemp1);
            //LOG("Item[%d]= %d\n", iTempCount, pItemArray[iTempCount] );
            iTempCount ++;

        }
    }
    return iTempCount;
}

bool LoadBinaryFile(const char* pszFileName, unsigned char* pbyFileBuf, int& iFileLen)
{
    if( !pszFileName || !pbyFileBuf )
	{
		iFileLen = 0;
		return false;
	}
	int iMaxFileLen = iFileLen;
	FILE *fp = fopen(pszFileName, "rb");
	if( !fp )
	{
	    printf("open file(%s) failed!\n", pszFileName);
		iFileLen = 0;
		return false;
	}
	fseek(fp, 0, SEEK_END);
    int iTempFileSize = ftell(fp);
	fseek(fp, 0, SEEK_SET);
	if( iTempFileSize > iMaxFileLen )
	{
		fclose(fp);
		printf("unzip buf len is so short\n");
		iFileLen = 0;
		return false;
	}
	fread(pbyFileBuf, iTempFileSize, 1, fp);
	fclose(fp);
	iFileLen = iTempFileSize;
	return true;
}

int WriteBufferToFile(char* pszFileName, char* pszFileBuffer, int nFileLen)
{
	FILE *fpDumpFile = fopen(pszFileName, "w");
	int iPageSize = 4096, iPageCount = 0, i;
	unsigned char *pPage = (unsigned char*)pszFileBuffer;

	if( !fpDumpFile )
	{
		return -1;
	}

	iPageCount = nFileLen/iPageSize;
	for( i = 0; i < iPageCount; i++ )
	{
		fwrite((const void *)pPage, iPageSize, 1, fpDumpFile);
		pPage += iPageSize;
	}
	fwrite((const void *)pPage, nFileLen - iPageSize*iPageCount, 1, fpDumpFile);

	fclose(fpDumpFile);
	return 0;
}

char* GetNextToken(const char *szSrc, char cSplitter, char *szToken)
{
	char *pcPos = NULL;
	int iTokenLength = 0;

	if( !szSrc )
    {
        if( szToken )
        {
            szToken[0] = '\0';
        }
        return NULL;
    }
    
    pcPos = strchr((char*)szSrc, (int)cSplitter);

    if( pcPos )
    {
        if( szToken )
        {
            iTokenLength = (int)(pcPos - szSrc);
            memcpy((void *)szToken, (const void *)szSrc, iTokenLength);
            szToken[iTokenLength] = '\0';
        }
        pcPos++;
    }
    else
    {
        if( szToken )
        {
            strcpy(szToken, szSrc);
        }
    }

	return pcPos;
}

int GetIfAddrs(int& riAddrNum, sockaddr_in *pstIfAddrs)
{
#ifdef _AUSTINTEST_
    int sockfd = socket(AF_INET, SOCK_DGRAM, 0);
    int iRet = 0;
    struct ifconf ifc;
    struct ifreq aifr[1024];
    int i;

    if( sockfd <= 0 )
    {
        printf("Create socket failed of %s.\n", strerror(errno));
        return -1;
    }
    ifc.ifc_buf = (char *)&aifr[0];
    ifc.ifc_len = sizeof(aifr);

    iRet = ioctl(sockfd, SIOCGIFCONF, &ifc);
    if( iRet )
    {
        printf("IO ctrl failed of %s\n", strerror(errno));
        close(sockfd);
        return -1;
    }

    if( ifc.ifc_len/sizeof(ifreq) < riAddrNum )
    {
        riAddrNum = ifc.ifc_len/sizeof(ifreq);
    }

    for( i = 0; i < riAddrNum; i++ )
    {
        memcpy((void *)&pstIfAddrs[i], (const void *)&aifr[i].ifr_addr, sizeof(sockaddr_in));
    }

    close(sockfd);

    return iRet;
#endif
    return 0;
}

int SetSockBufLen(int iSock, int iLength)
{
    int iRcvLen, iSndLen, iErr, iOptLen = sizeof(int);
    if( iSock < 0 || iLength < 0 )
    {
        return -1;
    }

    iRcvLen = iSndLen = iLength;
#ifndef WIN32
    iErr = setsockopt(iSock, SOL_SOCKET, SO_RCVBUF, &iRcvLen, iOptLen);
#else
    iErr = setsockopt(iSock, SOL_SOCKET, SO_RCVBUF, (const char*)&iRcvLen, iOptLen);
#endif
    if( iErr )
    {
        return -2;
    }
#ifndef WIN32
    iErr = setsockopt(iSock, SOL_SOCKET, SO_SNDBUF, &iSndLen, iOptLen);
#else
    iErr = setsockopt(iSock, SOL_SOCKET, SO_SNDBUF, (const char*)&iSndLen, iOptLen);
#endif
    if( iErr )
    {
        return -3;
    }

    return 0;
}

