struct tm *GetUpperTMFromTimeString(char *strTime)
{
	struct tm stTempTM;
	time_t tNow;

	if (GetTmFromString(stTempTM, strTime) != 0)
	{
		return NULL;
	}

	tNow = mktime(&stTempTM);

    if ((stTempTM.tm_min != 0) || (stTempTM.tm_sec != 0)) {
        tNow += 3600;
    }

    return localtime( &tNow );
}

