void ConvertHashToStr(unsigned char *pbyHash, char *pszHash)
{
	int i;
	char szTemp[4];
    for (i = 0; i < MD5_HASH_LEN; i++)
	{
		memset(szTemp, 0, sizeof(szTemp));
		sprintf(szTemp, "%02x", pbyHash[i]);
		memcpy(pszHash + 2 * i, szTemp, 2);
	}
	pszHash[32] = 0;
}

int ConvertStrToHash(char *pszHash, unsigned char *pbyHash)
{
    int i;
    int j;
    char szNum[2];
    char  nNum[2];

	if (NULL == pszHash || NULL == pbyHash)	{

		return -1;
	}

    if (2 * MD5_HASH_LEN != strlen(pszHash)) {
		LOG("ConvertStrToHash error pszHash [%s] len = [%d]\n", pszHash, strlen(pszHash));
		return -1;
	}


    for (i = 0; i < MD5_HASH_LEN; i++) {
		strncpy(szNum, "", sizeof(szNum));
		strncpy(nNum, "", sizeof(szNum));

		memcpy(szNum, pszHash + 2 * i, 2);

        for (j = 0; j < 2; j++)	{
			if ('0' <= szNum[j] && '9' >=szNum[j]) {
				nNum[j] = szNum[j] - '0';
				continue;
			}
			if ('A' <= szNum[j] && 'F' >=szNum[j]) {
				nNum[j] = szNum[j] - 'A' + 10;
				continue;
			}
            if ('a' <= szNum[j] && 'f' >=szNum[j]) {
				nNum[j] = szNum[j] - 'a' + 10;
				continue;
			}
            return -1;
		}
		pbyHash[i] = (unsigned char )(16 * nNum[0] + nNum[1]);
	//	LOG("%d\t", pbyHash[i]);
	}

    return 0;
}

int ConvertStrToByte(char *pszHash, unsigned char *pbyHash)
{
	int i;
	int j;
	char szNum[2];
	char  nNum[2];

	if (NULL == pszHash || NULL == pbyHash)
	{
		return -1;
	}
	int nStrLen = strlen(pszHash);
	if( nStrLen%2 != 0 )
	{
        return -2;
	}
	int nByteLen = nStrLen/2;

	for (i = 0; i < nByteLen; i++) 
	{
		strncpy(szNum, "", sizeof(szNum));
		strncpy(nNum, "", sizeof(szNum));

		memcpy(szNum, pszHash + 2 * i, 2);

		for (j = 0; j < 2; j++)	{
			if ('0' <= szNum[j] && '9' >=szNum[j]) {
				nNum[j] = szNum[j] - '0';
				continue;
			}
			if ('A' <= szNum[j] && 'F' >=szNum[j]) {
				nNum[j] = szNum[j] - 'A' + 10;
				continue;
			}
			if ('a' <= szNum[j] && 'f' >=szNum[j]) {
				nNum[j] = szNum[j] - 'a' + 10;
				continue;
			}
			return -1;
		}
		pbyHash[i] = (unsigned char )(16 * nNum[0] + nNum[1]);
	}
	return 0;
}

int CreateLockFiles(const char* pszFilePath, int nSize)
{
#ifndef WIN32
    if (access(pszFilePath, 0) == -1)
    {
        int fd = open(pszFilePath, O_RDWR|O_CREAT, 0);
        if (fd < 0)
        {
            printf("create lock file %s error: %m", pszFilePath);
            return -1;
        }
        lseek(fd, nSize - sizeof(int), SEEK_SET);
        write(fd, &nSize, sizeof(int));
        close(fd);
        chmod(pszFilePath, 0600);
    }
#endif
    return 0;
}

int CreateCacheLock(char* pLockPath, int* pLockFd)
{
#ifndef WIN32
        int nFD;
        int i;
		bool bCreate = false;

        if( pLockFd == NULL )
		{
			return -1;
        }

		if( access(pLockPath, 0) == -1 )
		{
			bCreate = true;
		}

        if( (nFD = open( pLockPath, O_RDWR|O_CREAT|O_TRUNC, S_IRUSR|S_IWUSR|S_IRGRP|S_IWGRP|S_IROTH|S_IWOTH)) < 0 )
        {
            fprintf( stderr, "open lock file failed. File[%s],nRet: %d desc: %s\n", pLockPath, errno, strerror(errno));
            return -1;
        }

		if( bCreate == true )
        {
	        /*写入一些字节用于锁*/
	        for( i = 0; i < 256; i++ )
	        {
	            if( write(nFD, "0", 1 ) != 1)
	            {
	                fprintf( stderr, "write file failed.nFD=%d,nRet: %d desc: %s\n", nFD, errno, strerror(errno));
	                return -2;
	            }
	        }
		}

        *pLockFd = nFD;
#endif
        return 0;
}

int CacheLock(int nLockFd, int nType)
{
#ifndef WIN32
	struct flock    writelock;

	writelock.l_type = F_WRLCK;
	writelock.l_start = nType;
	writelock.l_whence = SEEK_SET;
	writelock.l_len = 1;

	if( fcntl(nLockFd, F_SETLKW, &writelock) == -1 )
	{
	    fprintf( stderr, "nLockWriteEx fcntl F_WRLCK failed.nFD=%d,nRet: %d desc: %s\n", nLockFd, errno, strerror(errno));
	    return -1;
	}

#endif
	return 0;
}

int CacheUnLock(int nLockFd, int nType)
{
#ifndef WIN32
	struct flock    writelock;

	writelock.l_type = F_UNLCK;
	writelock.l_start = nType;
	writelock.l_whence = SEEK_SET;
	writelock.l_len = 1;

	if( fcntl(nLockFd, F_SETLKW, &writelock) == -1 )
	{
	    fprintf( stderr, "nUnlockWriteEx fcntl F_UNLCK failed.nFD=%d,nRet: %d desc: %s\n",  nLockFd, errno, strerror(errno));
	    return -1;
	}
#endif
	return 0;
}

int ConvertTimeFromStringToIntInt(char* sTime)
{
        char* p = sTime;
        char* q = NULL;
        int iYear, iMonth, iDay;
        char sBuffer[16];
        struct tm TM;
        int iTime = 0;

        int nTimeLen = (int)strlen(sTime);
        if (nTimeLen != 10 || sTime[4] != '-' || sTime[7] != '-')
        {
            return -1;
        }
        int nSep = 0;
        for (int nChar = 0; nChar < nTimeLen; nChar++)
        {
            if (!isdigit(sTime[nChar]))
            {
                nSep++;
            }
        }
        if (nSep > 2)
        {
            return -1;
        }
        q = strchr(p, '-');
        if (q == NULL)
        {
            return -1;
        }
        memset(sBuffer, 0, sizeof(sBuffer));
        memcpy(sBuffer, p, q - p);
        iYear = atoi(sBuffer);

        p = q + 1;

        q = strchr(p, '-');
        if (q == NULL)
        {
            return -1;
        }
        memset(sBuffer, 0, sizeof(sBuffer));
        memcpy(sBuffer, p, q - p);
        iMonth = atoi(sBuffer);

        p = q + 1;
        memset(sBuffer, 0, sizeof(sBuffer));
        memcpy(sBuffer, p, strlen(p));
        iDay = atoi(sBuffer);

        memset(&TM, 0, sizeof(struct tm));

        TM.tm_year = iYear - 1900;
        TM.tm_mon = iMonth - 1;
        TM.tm_mday = iDay;

        iTime = (int)mktime(&TM);

        return iTime;
}

void CreatePath(char szLogPath[MAX_PATH])
{
	if (0 == szLogPath[0])
	{
		printf("CreatePath Error!\n");
		return;
	}
	char szTempLogPath[MAX_PATH];
	memset(szTempLogPath, 0, sizeof(szTempLogPath));
	strncpy(szTempLogPath, szLogPath, sizeof(szTempLogPath) - 1);
	int iTempLen = strlen(szTempLogPath);

	if('/' == szTempLogPath[iTempLen - 1])
	{
		szTempLogPath[iTempLen - 1] = 0;
	}
	char *pTemp = szTempLogPath;
	char *pTemp1;
	char chTemp;
	while(1)
	{
		pTemp1 = strchr(pTemp, '/');
		if(0 == pTemp1)
		{
			MKDIR(szTempLogPath, 0777);
			break;
		}
		if(0 == *(pTemp1 + 1))
		{
			break;
		}

		chTemp = *(pTemp1 + 1);
		*(pTemp1 + 1) = 0;
		if (0 != strcmp("../", szTempLogPath) && 0 != strcmp("./", szTempLogPath))
		{
			MKDIR(szTempLogPath, 0777);
		}
		*(pTemp1 + 1) = chTemp;
		pTemp = pTemp1 + 1;
	}
}

unsigned int IPStr2Value(const char *pszIP) 
{   
	int           nNum  = 0;          
	const char    *pBeg = pszIP;   
	const char    *pPos = NULL;   
	unsigned int  ulIP  = 0;         

	pPos = strchr(pszIP, '.');   
	while (pPos != NULL)
	{   
		nNum = atoi(pBeg);   
		ulIP += nNum;   
		ulIP *= 0x100;   
		pBeg = pPos + 1;   
		pPos = strchr(pBeg, '.');   
	}   

	nNum = atoi(pBeg);   
	ulIP += nNum;   
	return htonl(ulIP);   
}  

void IPValue2Str(unsigned int uIPValue, char szIPStr[IP_LENGTH])
{
	if ( !szIPStr ) 
	{   
		return;   
	}   
    memset(szIPStr, 0, IP_LENGTH);
	snprintf(szIPStr, IP_LENGTH - 1, "%u.%u.%u.%u", 
		uIPValue & 0x000000FF, (uIPValue & 0x0000FF00) >> 8, 
		(uIPValue & 0x00FF0000) >> 16, (uIPValue & 0xFF000000) >> 24);   
	szIPStr[IP_LENGTH - 1] = 0;  
}

