int GBK2UTF8(char* strgbk, char* strutf8)
{
	unsigned int strGbkLen = strlen(strgbk);
	unsigned int indexUtf8 = 0, indexGbk = 0, iUtf8;
	int cTmp;

	while (strGbkLen > indexGbk)
	{
		cTmp = (*(strgbk + (indexGbk++))) & 0xFF;

		if (cTmp < 0x80) /*1位*/
		{
			iUtf8 = zzGbk2utf8base[cTmp];
			strutf8[indexUtf8++] = iUtf8;
		}
		else
		{
			if ((strGbkLen - indexGbk) < 1)
			{
				break;
			}
			cTmp <<= 8;
			cTmp |= ((*(strgbk + (indexGbk++))) & 0xFF);

			iUtf8 = zzGbk2utf8base[cTmp];

			if (iUtf8 < 0xD192)/*2位*/
			{
				strutf8[indexUtf8++] = iUtf8 >> 8;
				strutf8[indexUtf8++] = iUtf8 & 0xFF;
			}
			else/*3位 0xD192*/
			{
				strutf8[indexUtf8++] = iUtf8 >> 16;
				strutf8[indexUtf8++] = (iUtf8 >> 8) & 0xFF;
				strutf8[indexUtf8++] = iUtf8 & 0xFF;
			}
		}
	}
	strutf8[indexUtf8] = '\0';
	return 0;
}


/*
 * utf8 -> unicode
 * utf8char 字符串向后移
 */
int UTF82Unicode(char* utf8char, int* unicode, int* len, int leaveLen)
{
	char cTmp = *utf8char;
	if ((cTmp & 0xF8)  == 0xF0) /*4位*/
	{
		if ( leaveLen < 4 || 
			  (((*(utf8char + 1)) & 0xC0) != 0x80) || 
			  (((*(utf8char + 2)) & 0xC0) != 0x80) ||
			  (((*(utf8char + 3)) & 0xC0) != 0x80) )
		{
			return 2;/*剩余位数不够 */
		}
		*len = 4;
		*unicode |= (cTmp & 0x07);
		*unicode <<= 6;
		
		cTmp = *(utf8char + 1);
		*unicode |= (cTmp & 0x3F);
		*unicode <<= 6;
		
		cTmp = *(utf8char + 2);
		*unicode |= (cTmp & 0x3F);
		*unicode <<= 6;
		
		cTmp = *(utf8char + 3);
		*unicode |= (cTmp & 0x3F);
	}
	else if ( (cTmp & 0xF0) == 0xE0) /* 3位 */
	{
		if ( leaveLen < 3 || 
			  (((*(utf8char + 1)) & 0xC0) != 0x80) || 
			  (((*(utf8char + 2)) & 0xC0) != 0x80) )
		{
			return 2;/*剩余位数不够 */
		}
		*len = 3;
		*unicode |= (cTmp & 0x0F);
		*unicode <<= 6;
		
		cTmp = *(utf8char + 1);
		*unicode |= (cTmp & 0x3F);
		*unicode <<= 6;
		
		cTmp = *(utf8char + 2);
		*unicode |= (cTmp & 0x3F);
	}
	else if ( (cTmp & 0xE0) == 0xC0) /* 2位 */
	{
		if ( leaveLen < 2 || 
			  (((*(utf8char + 1)) & 0xC0) != 0x80) )
		{
			return 2;/*剩余位数不够 */
		}
		*len = 2;
		*unicode |= (cTmp & 0x1F);
		*unicode <<= 6;
		
		cTmp = *(utf8char + 1);
		*unicode |= (cTmp & 0x3F);

	}
	else if ( (cTmp & 0x80) == 0x00) /* 1位 */
	{
		*len = 1;
		*unicode = cTmp;
	}
	else
	{
		return 1; /*第一位不合法*/
	}
	
	return 0;
}

int UTF82GBK(char* strutf8, char* strgbk)
{
	int unicode = 0, gbk;
	int strUtf8Len = strlen(strutf8);
	int indexUtf8 = 0, indexGbk = 0, lenTmp;
	while (strUtf8Len > indexUtf8)
	{
		unicode = 0;
		lenTmp = 0;
		if (UTF82Unicode(strutf8 + indexUtf8, &unicode, &lenTmp, strUtf8Len - indexUtf8) != 0)
		{
			indexUtf8++;
			continue;
		}

		gbk = zzUnicode2gbkbase[unicode];

		if (lenTmp == 3)
		{
			strgbk[indexGbk++] = gbk >> 8;
			strgbk[indexGbk++] = gbk & 0xFF;
		}
		else if (lenTmp == 1)
		{
			strgbk[indexGbk++] = gbk & 0xFF;
		}
		else if (lenTmp == 2)
		{
			strgbk[indexGbk++] = gbk >> 8;
			strgbk[indexGbk++] = gbk & 0xFF;
		}
		else if (lenTmp == 4)
		{
			strgbk[indexGbk++] = gbk >> 8;
			strgbk[indexGbk++] = gbk & 0xFF;
		}

		indexUtf8 += lenTmp;
	}
	strgbk[indexGbk] = '\0';

	return 0;
}


