int EncodeLongLong(char **pstrEncode, unsigned long long ullSrc)
{
	unsigned long long temp = 0;

	if (pstrEncode == NULL || *pstrEncode == NULL)
	{
		return 0;
	}

	unsigned long long low = (ullSrc & 0xffffffff);
	unsigned long long high = (ullSrc >> 32);
	low = htonl(low);
	high = htonl(high);

	low = (low << 32);
	temp = high | low;

	memcpy((void*)(*pstrEncode), (const void*)(&temp), sizeof(unsigned long long));
	*pstrEncode += sizeof(unsigned long long);
	return (int)sizeof(unsigned long long);
}

int DecodeLongLong(char **pstrDecode, unsigned long long *pullDest)
{
	unsigned long long temp = 0;

	if ( pstrDecode == NULL || *pstrDecode == NULL || pullDest == NULL)
	{
		return 0;
	}

	memcpy((void*)(&temp), (const void*)(*pstrDecode), sizeof(unsigned long long));
	*pstrDecode += sizeof(unsigned long long);

	unsigned long long low = (temp & 0xffffffff);
	unsigned long long high = (temp >> 32);
	low = ntohl(low);
	high = ntohl(high);

	low = (low << 32);

	temp = (high | low);

	*pullDest = temp;

	return (int)sizeof(unsigned long long);
}

